<script id="csinit" type="text/x-cindyscript">
//KETlib
use("KetCindyPlugin");
Dircdy=loaddirectory;
setdirectory(gethome());
import("ketcindy.ini");

allflg=0;

;

</script>
<script id="cskeytyped" type="text/x-cindyscript">
//Script (CindyScript)
kL=keydownlist();
if(length(kL)>0,
  if(kL==[17,70], //Ctr+f (Figures)
    Viewtex();
    kc();
  );
  if(kL==[16,17,80], //Ctr+Shift+p (Parent)
    if(length(Shellparent)>0,
      Makeshell(),Makebat();
    );
    WritetoSci(2);
    kc();
  );
  if(kL==[17,74], //Ctr+j (Ketjsoff)
    Mkketcindyjs(append(KETJSOP,"Web=n"));
  );
  if(kL==[16,17,74], //Ctr+Shift+j (Ketjson)
    Mkketcindyjs(append(KETJSOP,"Web=yj"));
  );
);
;

</script>
<script id="csmouseclick" type="text/x-cindyscript">
//Script (CindyScript)
mp=mouse().xy;

;

</script>
<script id="csdraw" type="text/x-cindyscript">
//figures
Ketinit();

//Putpoint("T1",[0,0],T1.xy);
//Putpoint("T4",[-5,0],T4.xy);

xL=[50];
yL=apply(1..15,8);
Tabledata("1",xL,yL,[],
     [0,"Setwin=n","Move=[-12,-7]","Msg=n"]);
mv=[-12,-7];

setdirectory(Dircdy);


//メデイアブラウザーで登録
Fhead="0508-3";
drawimage(T1.xy,Fhead+".png",scale->2);
drawtext(T4.xy,text(T1.xy),scale->16);


//HTMLに書き出す
filein=Namecdy+".html";

if(allflg==1,
  data=Readlines(Dircdy,filein);
  dline=select(1..(length(data)),
         indexof(data_#,"drawimage(")>0);
  tmp=dline_1;
  fname=Fhead+"script.txt";
  fid=openfile(fname);
    println(fid,data_(tmp-1));
    println(fid,data_tmp);
    println(fid,data_(tmp+1));
  closefile(fid);
  allflg=0;
);

if(allflg==2,
  data=Readlines(Dircdy,filein);
  dline=select(1..(length(data)),
         indexof(data_#,Fhead)>0);
  tmp=dline_(-1);
  tmp1=data_tmp;
  fname=Fhead+"png.txt";
  fid=openfile(fname);
    println(fid,data_tmp);
  closefile(fid);
  allflg=0;
);

if(allflg==3,
  tmp=Filelist(Dircdy);
  fileL=select(tmp,indexof(#,Fhead+".html")>0);
  fname=fileL_1;
  data=Readlines(Dircdy,fname);
  tmp=select(1..(length(data)),
          indexof(data_#,"csconsole:")>0);
  dline1=tmp_1;
  data1=data_(1..dline1);
  tmp=select(dline1..(length(data)),
          indexof(data_#,"cinderella:")>0);
  dline2=tmp_1;
  data3=data_(dline2..(length(data)));
  if(dline2==dline1+1,
    data1=append(data1,"  images: {");
    data3=prepend(" },",data3);
    data2=[];
  ,
    data2=data_((dline1+1)..(dline2-1));
    tmp=data2_(-1);
    if(tmp_(-1)!=",",
      data2_(-1)=tmp+",";
    );
  );
  data=Readlines(Dircdy,Fhead+"png.txt");
  tmp=data_(-1);
  if(tmp_(-1)==",",
    data_(-1)=substring(tmp,0,length(tmp)-1);
  );
  tmp1=concat(data1,data2);
  tmp2=concat(tmp1,data);
  data=concat(tmp2,data3);
  dline=select(1..(length(data)),
          indexof(data_#,"Ketinit(")>0);
  dline=dline_(-1);
  data1=data_(1..dline);
  data2=data_((dline+1)..(length(data)));
  data=Readlines(Dircdy,Fhead+"script.txt");
  data=concat(data1,data);
  data=concat(data,data2);
  fname=replace(fname,".html","new.html");
  setdirectory(Dircdy);
  fid=openfile(fname);
  forall(data,
    println(fid,#);
  );
  closefile(fid);
  allflg=0;
);

Windispg();

;

</script>
